//You can use jQuery but keep in mind that javascript is NOT scoped to spec!
//All JS and CSS are global scope!

var getPage = function() {

  if (event) 
  { 
  
	event.preventDefault(); 
	
	var clickObj = $(event.target),
		linkObj = clickObj.is("[href]") ? clickObj : clickObj.closest("a"),
		url = linkObj.attr('href'),
		id = linkObj.closest('.paging-container').attr('id'),
		target = '#' + id;

	// load the html page and select the right fragment
	$(target).load(url + " " + target, function() {
		// replace the original container by moving it's contents and deleting it
		$(target)
		  .children()
			.appendTo($(target).parent());
		$(target).remove();

		// set the browser history state
		if (history.pushState) {
		  history.pushState(null, null, url);
		}
	                  
	});
  }
 
  return false;
}

var layerHandler = function(event) {

  event.preventDefault();

  var dataTarget = $(event.target);
  var dataId = dataTarget.is("[data-layer-id]") ? dataTarget.attr("data-layer-id") : dataTarget.closest("[data-layer-id]").attr("data-layer-id");
  var dataLayerId = '[data-layer-id="' + dataId + '"]';
  var layerId = '#' + dataId;
  var parentLayer = $(layerId).parents(".layer");

  // hide a popup
  if ($(layerId).is(':visible')) {
    $(layerId).hide().removeClass('is-shown').addClass('is-hidden');
    $(dataLayerId).removeClass('open').find('.i-arrow').toggleClass('up down');

    // pause the video when the popup is hidden
    if ($(layerId).find('iframe')[0]) {
      $(layerId).find('iframe')[0].contentWindow.postMessage('{"event":"command","func":"pauseVideo","args":""}', '*');
    }

    // to avoid nested popups (coutrnyselector mobile...) removing the background fade
    // only a top level popup can remove the bg
    if ( parentLayer.length == 0 ) {
      $('.bg-mask').remove();
    }

  // open a popup
  } else {
    // to avoid nested popups (coutrnyselector mobile...) cfreating a second background fade
    // only a top level popup can remove the bg
    if ( $(".bg-mask.lightbox").length == 0 ) {
      $('body').append("<div class='bg-mask lightbox'></div>");
    }
    // append to bottom of page, except for navigation menus
    if ( !$(layerId).is(".layer--inline") ) {
      $(layerId).appendTo("body")
    }
    // show stuff and set states
    $(layerId)
      .show()
      .removeClass('is-hidden')
      .addClass('is-shown')
      .css("display", "block");
    $(dataLayerId).addClass('open').find('.i-arrow').toggleClass('up down');

    // scroll a nested layer into view
    if ( parentLayer.length != 0 ) {
      parentLayer.animate({
          scrollTop: $(layerId).position().top - 76
      }, 250);
    }
  }


  $(document).keyup(function (e) {
    if (e.keyCode == 27) {

      $(layerId)
        .hide()
        .removeClass('is-shown')
        .addClass('is-hidden');

      $(dataLayerId)
        .removeClass('open')
        .find('.i-arrow')
          .toggleClass('up down');

      $('.bg-mask').remove();
    }
  });
};

var doUpload = function() {

  $(".is-upload [type='file']")
    // this works only with a input type="file"
    // does not support drag-n-drop or multiple file uploads
    .change(function(event) {

      var myFileObj = event.target;

      $(myFileObj)
        .closest(".is-upload")
          .find(".is-upload__filename")
            .text( myFileObj.value.match(/[^\\\/]+$/) );
    });
}

doUpload();

var getUrlParameter = function(sParam) {
    var sPageURL = decodeURIComponent(window.location.search.substring(1)),
        sURLVariables = sPageURL.split('&'),
        sParameterName,
        i;

    for (i = 0; i < sURLVariables.length; i++) {
        sParameterName = sURLVariables[i].split('=');

        if (sParameterName[0] === sParam) {
            return sParameterName[1] === undefined ? true : sParameterName[1];
        }
    }
};
//You can use jQuery but keep in mind that javascript is NOT scoped to spec!
//All JS and CSS are global scope!
function mainNav() {
  var mouseOutTimeout;
  var mouseOutTimeoutDuration = 100;

  $('.navigation-main .wrapper > .item').hover(function () {
    const itemId = $(this).attr('data-item-id');
    const dataLayerId = '[data-item-id="' + itemId + '"]';
    clearTimeout(mouseOutTimeout);
    var itemHeight = $(this).outerHeight();
    var submenuTopOffset = Math.round($(this).offset().top + itemHeight);
    var doesBgLayerExist = $('.bg-mask').length;

    if(doesBgLayerExist <= 0) {
      $('.navigation-main').append("<div class='bg-mask'></div>");
    } else {
      $(".bg-mask").show();
    }
    $('.subs-wrapper').removeClass('hover');
    $('.subs-wrapper' + dataLayerId).addClass('hover').css('top',submenuTopOffset);
  }, function () {
    $('.bg-mask').remove();
    mouseOutTimeout = setTimeout(function() {
      $('.subs-wrapper').removeClass('hover');
    }, mouseOutTimeoutDuration);
  });

  $('.subs-wrapper').each(function () {
    $(this).remove().clone().appendTo('body');
  });

  $('.subs-wrapper').hover(function () {
    const itemId = $(this).attr('data-item-id');
    const dataLayerId = '[data-item-id="' + itemId + '"]';
    clearTimeout(mouseOutTimeout);
    $(this).addClass('hover');
    $('.navigation-main .wrapper').find('.item' + dataLayerId).addClass('hover');

    var doesBgLayerExist = $('.bg-mask').length;
    if(doesBgLayerExist <= 0) {
      $('.navigation-main').append("<div class='bg-mask'></div>");
    }
  }, function () {
    $('.navigation-main .wrapper > .item').removeClass('hover');
    $('.bg-mask').remove();
    mouseOutTimeout = setTimeout(function() {
      $('.subs-wrapper.hover').removeClass('hover');
    }, mouseOutTimeoutDuration);
  });

} mainNav();

$(window).scroll(function () {
    var scroll = $(window).scrollTop();
    var targetForScrollClass = 'body';

    if (scroll >= 10) {
      $(targetForScrollClass).addClass('scroll');
    } else {
      $(targetForScrollClass).removeClass('scroll');
    }
  });

var cookieHandler = function(){
	var now = new Date();

	now.setMonth( now.getMonth() + 12 );
	document.cookie = 'CC_CONSENT=true;expires=' + now.toUTCString();

	$(".cookies").fadeOut();
}

$(document).ready(function(){
	var cookieName = "CC_CONSENT";
	setTimeout(function(){
		if(typeof document !== 'undefined' && document.cookie.indexOf(cookieName) < 0) {
			$(".cookies").fadeIn();
		}
	},5000);
});

function fullStory() {
  $('.full-story__control .btn').on('click', function () {
    var fullstoryContainer = $(this).closest('.full-story'),
        storyContainer = fullstoryContainer.find('.body-content'),
        storyHeight = storyContainer.find('.body-content__inner').innerHeight();

    storyContainer.css('height', storyHeight);

    setTimeout(function () {
      fullstoryContainer.removeClass('is-collapsed');
      storyContainer.css('height', 'auto');
    }, 350);
  });
}fullStory();

var carouselHandler = function (carouselId) {

  var carouselItemId = $('#' + carouselId);
  var carouselConfig = false;

  if ( carouselItemId.is(".carousel--1-2-4") ) {    carouselConfig = "productlist"; }
  if ( carouselItemId.is(".carousel--assets") ) {     carouselConfig = "assets"; }

  switch (carouselConfig) {
    case "productlist":

      $(carouselItemId).slick({
        infinite: false,
        autoplay: false,
        dots:true,
        dotsClass:'numSlides',
        fade: false,
        respondTo:'slider',
        speed: 600,
        lazyLoad:'ondemand',
        prevArrow:'<button class="carousel-nav prev fa fa-long-arrow-left" aria-hidden="true"></button>',
        nextArrow:'<button class="carousel-nav next fa fa-long-arrow-right" aria-hidden="true"></button>',
        focusOnSelect: true,
        waitForAnimate:false,
        slidesToShow: 4,
        slidesToScroll: 4,
        responsive: [
          {
            // max-width:
            breakpoint: 658,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2
            }
          }
        ]
      });

    break;
    case "assets":

      $(carouselItemId).slick({
        infinite: true,
        autoplay: false,
        dots:true,
        dotsClass:'numSlides',
        fade: false,
        respondTo:'slider',
        speed: 600,
        lazyLoad:'ondemand',
        prevArrow:'<button class="carousel-nav prev fa fa-long-arrow-left" aria-hidden="true"></button>',
        nextArrow:'<button class="carousel-nav next fa fa-long-arrow-right" aria-hidden="true"></button>',
        focusOnSelect: true,
        waitForAnimate:false
      });

    break;
    default:

      $(carouselItemId).slick({
        infinite: true,
        autoplay: true,
        autoplaySpeed:6000,
        adaptiveHeight: true,
        dots:true,
        dotsClass:'numSlides',
        fade:true,
        respondTo:'slider',
        speed:1000,
        lazyLoad:'ondemand',
        prevArrow:'<button class="carousel-nav prev fa fa-long-arrow-left" aria-hidden="true"></button>',
        nextArrow:'<button class="carousel-nav next fa fa-long-arrow-right" aria-hidden="true"></button>',
        focusOnSelect: true,
        waitForAnimate:false
      });
  }
};

$('document').ready(function () {
  setTimeout(function () {

    $('.carousel').each(function () {
      carouselHandler($(this).attr('id'));
    });

  }, 500);
});
